class GOTCharacterListFragment : Fragment() {


    override fun onCreateView(
        inflater: LayoutInflater,
        container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        val view = inflater.inflate(R.layout.fragment_g_o_t_character_list, container, false)

        val recyclerView = view.findViewById<RecyclerView>(R.id.character_recycler_view)

        recyclerView.layoutManager = LinearLayoutManager(requireContext())

        val characters = mutableListOf<com.kroger.classdemoapp.Character>()   //com.kroger.classdemoapp.Character

        characters.add(John())
        characters.add(Stannis())
        characters.add(Tryion())
        characters.add(Joffery())
        characters.add(Daenerys())
        characters.add(Eddard())
        characters.add(Sansa())

        for (i in 0..30) {
            characters.add(createCharacterWW())
        }

        val adapter = CharacterAdapter(characters)
        recyclerView.adapter = adapter

        return view
    }

